const Feat = () => {
  return (
    <>
      <section className="feat">
        <div className="container">
          <div className="Feat">
            <h1>App Features</h1>
            <p>
              Start connecting with <span id="trench">Trench</span> and join a
              vibrant community of diverse individuals <br /> who share your
              interest and enthusiasim.
            </p>
          </div>
          <div className="bloc-tabs">
            <div className="tabs ">How can i join Trenchcommunity</div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Feat;
